import React from "react";

const TeacherSearchingCard = (props) => {
  return (
    <div>
      <h4>first name: {props.firstName}</h4>
      <h4>last name: {props.lastName}</h4>
      <h4>email name: {props.email}</h4>
      <h4>specialization : {props.specialization}</h4>
      <br></br>
      {
        props.deleteStatus && <button onClick={props.deleteFun}>Fire</button>
      }
      
    </div>
  );
};

export default TeacherSearchingCard;
